// --- Code Node for Creating Service Request Page ---

// Use try...catch for robust error handling
try {
  // --- 1. Get Data from Previous Nodes ---
  const formData = $('Typeform Trigger').first().json; // Original Typeform data

  // Get the Client ID from the Merge node
  const clientId = $('Merge').first().json["notion client id"];
  if (!clientId) {
    throw new Error("Could not find 'notion client id' from Merge node.");
  }

  // --- 2. Define Values for Properties ---
  let serviceRequestName; // Declare variable

  // Get the actual Client Name passed through the Merge node
  const clientName = $('Merge').first().json["first name"];
  if (!clientName) {
    // Fallback if clientName wasn't found in Merge node output
    console.warn("Client Name not found in Merge node output. Falling back to Typeform First Name.");
    const firstNameFallback = formData['First name'] || 'Unknown Client';
    serviceRequestName = `${firstNameFallback} - Buyer Success Story`;
  } else {
    // Construct the desired service request name using the Client Name
    serviceRequestName = `${clientName} - Buyer Success Story`;
  }

  const requestTypeValue = "Buyer Success Story"; // Set the type specifically
  const submissionDateISO = new Date().toISOString(); // Get current date/time in UTC ISO format

  // --- 3. Generate Content Blocks (Page Body from Typeform) ---
  const contentBlocks = [];

  // Add a title block to the page body for clarity
  contentBlocks.push({
    object: "block",
    type: "heading_1",
    heading_1: {
      rich_text: [{
        type: "text",
        text: { content: serviceRequestName }
      }]
    }
  });

  // Add a divider
  contentBlocks.push({ object: "block", type: "divider", divider: {} });

  // Define question categories to group related items (reduces block count)
  const basicInfoQuestions = ["First name", "Last name", "Email"];
  const propertyDetailsQuestions = ["Property Address", "City", "Province/State", "Country", "Listed Price:", "Purchased Price:"];
  const purchaseDetailsQuestions = [
    "Was this home a multiple-offer situation?",
    "Any Other Relevant Stats",
    "Google Drive Link:"
  ];
  const buyerProfileQuestions = [
    "Who were the buyers? (First-time homebuyers, upsizing family, relocating, downsizers, investors, etc.)",
    "What challenges did they face when looking for a home?",
    "What was their biggest fear about the home-buying process?",
    "What were their initial goals and expectations for the home search?",
    "How many homes did they view before finding \"the one\"?",
    "What were their top 3 \"must-haves\" in a home?"
  ];
  const dealProcessQuestions = [
    "Did they face any bidding wars or competitive situations? (How did you navigate them?)",
    "Were there any unique strategies you used to help them win their dream home? (e.g., pre-offer inspections, personalized letters, negotiation tactics, etc.)",
    "Did you help them negotiate better terms beyond just price? (Closing date, fewer conditions, seller credits, etc.)",
    "What was the final purchase price vs. the original asking price?",
    "How fast did they move from offer to closing? (Was it a quick closing or a drawn-out process?)"
  ];
  const outcomeQuestions = [
    "How did this purchase change the buyer's life? (First home, investment opportunity, closer to family, job relocation, etc.)",
    "What unexpected benefits did they gain from this purchase? (Investment potential, dream location, perfect school district, etc.)",
    "How did this transaction compare to the current market conditions? (Were they able to secure a deal in a tough market?)",
    "Was there anything unique or surprising about this purchase? (e.g., buyer got a great deal, won a bidding war, secured a rare property, etc.)",
    "Any \"Before & After\" transformations? (e.g., \"We made one simple change, and it led to 10+ offers!\")",
    "Did you help the buyers achieve something they didn't think was possible?"
  ];
  const agentExperienceQuestions = [
    "Why did they choose to work with you over another agent?",
    "What was the most rewarding part of this deal for you as their agent?",
    "Did the buyers leave a testimonial or share feedback about their experience?",
    "What's one thing the buyer said that would resonate with future clients considering buying a home?",
    "Has this client given you a review?"
  ];
  const marketInsightsQuestions = [
    "If another buyer is thinking about purchasing, what's the #1 thing they should know about today's market?",
    "What's the biggest misconception about buying a home that you'd like to clear up?",
    "What advice would you give to someone on the fence about buying a home?"
  ];
  const clientIdentificationQuestions = [
    "Is the client okay with their name being shared, or should it remain private? (Select One)",
    "Client's Name"
  ];

  // Define all sections with their questions
  const sections = [
    { title: "Basic Information", questions: basicInfoQuestions },
    { title: "Property Details", questions: propertyDetailsQuestions },
    { title: "Purchase Details", questions: purchaseDetailsQuestions },
    { title: "Buyer Profile", questions: buyerProfileQuestions },
    { title: "Deal Process", questions: dealProcessQuestions },
    { title: "Outcome and Benefits", questions: outcomeQuestions },
    { title: "Agent Experience & Testimonials", questions: agentExperienceQuestions },
    { title: "Market Insights & Advice", questions: marketInsightsQuestions },
    { title: "Client Identification", questions: clientIdentificationQuestions }
  ];

  // Process each section
  for (const section of sections) {
    // Add section heading
    contentBlocks.push({
      object: "block",
      type: "heading_2",
      heading_2: {
        rich_text: [{ type: "text", text: { content: section.title } }],
        color: "default"
      }
    });

    // Process questions for this section
    for (const questionText of section.questions) {
      // Clean up the question key by removing asterisks
      const cleanQuestion = questionText.replace(/\*/g, '').trim();

      // Find the answer in formData by comparing cleaned versions of keys
      let answerKey = null;
      let answer = null;

      for (const key of Object.keys(formData)) {
        const cleanKey = key.replace(/\*/g, '').trim();
        if (cleanKey === cleanQuestion) {
          answerKey = key;
          answer = formData[key];
          break;
        }
      }

      if (!answerKey) continue; // Skip if question not found

      // Format the answer
      let formattedAnswer;
      if (answer === undefined || answer === null || answer === '') {
        formattedAnswer = 'Not provided';
      } else if (Array.isArray(answer)) {
        formattedAnswer = answer.join(', ');
      } else if (typeof answer === 'object' && answer !== null && !Array.isArray(answer) && !(answer instanceof Date)) {
        if (answer.hasOwnProperty('url') && answer.hasOwnProperty('name')) {
          formattedAnswer = answer.url; // Handle file objects
        } else {
          formattedAnswer = JSON.stringify(answer); // Stringify other objects
        }
      } else if (typeof answer === 'boolean') {
        formattedAnswer = answer ? 'Yes' : 'No';
      } else {
        formattedAnswer = String(answer);
      }

      // Check for image URLs
      const isImageUrl = typeof formattedAnswer === 'string' && (
        formattedAnswer.includes('api.typeform.com/responses/files') ||
        (formattedAnswer.startsWith('http') && (
          formattedAnswer.endsWith('.jpg') || 
          formattedAnswer.endsWith('.png') ||
          formattedAnswer.endsWith('.jpeg') || 
          formattedAnswer.endsWith('.gif')
        ))
      );

      // Handle images or regular text differently
      if (isImageUrl) {
        // For images, add question as bold text first
        contentBlocks.push({
          object: "block", 
          type: "paragraph",
          paragraph: {
            rich_text: [
              { type: "text", text: { content: cleanQuestion + ":" }, annotations: { bold: true } }
            ],
            color: "default"
          }
        });

        // Then add the image
        contentBlocks.push({
          object: "block", 
          type: "image", 
          image: { 
            type: "external", 
            external: { url: formattedAnswer } 
          }
        });
      } else {
        // Add the question and answer in a single paragraph (bold question, regular answer)
        contentBlocks.push({
          object: "block", 
          type: "paragraph",
          paragraph: {
            rich_text: [
              { type: "text", text: { content: cleanQuestion + ": " }, annotations: { bold: true } },
              { type: "text", text: { content: formattedAnswer } }
            ],
            color: "default"
          }
        });
      }
    }
  }

  // Count final number of blocks for debugging
  console.log(`Total content blocks: ${contentBlocks.length}`);

  // Check if we're over the limit
  if (contentBlocks.length > 95) {
    console.warn(`Warning: Block count (${contentBlocks.length}) is approaching the Notion limit of 100`);
  }

  // --- 4. Prepare Data for Notion API ---
  const notionDataPayload = {
    parent: {
      // The Database ID for your Service Requests database
      database_id: "1b41d08c4f5a80c1a843f04215bd0fd0"
    },
    icon: {
      type: "emoji",
      emoji: "ðŸŽ‰"
    },
    properties: {
      // Title Property: Name
      "Name": {
        title: [{ text: { content: serviceRequestName } }]
      },
      // Select Property: Request Type
      "Request Type": {
        select: {
          name: requestTypeValue
        }
      },
      // Relation Property: Client
      "Client": {
        relation: [{ id: clientId }]
      },
      // Date Property: Submission Date
      "Submission Date": {
        date: {
          start: submissionDateISO
        }
      }
    },
    // Page Body Content: Children
    children: contentBlocks
  };

  // --- 5. Return the Payload ---
  // Output the data needed for the subsequent HTTP Request node
  return { json: { notionData: notionDataPayload } };

} catch (error) {
  // --- Error Handling ---
  console.error('Error preparing Service Request Notion data:', error.message);
  throw error; // Stop workflow on error
}
